function get_data_array(data_arr,knife_number,teeth_number) {
    // determine knife period first
    var res_data_arr = [];
    for(let i=(knife_number-1)*315; i<knife_number*315; i++){
        res_data_arr.push(data_arr[i][teeth_number-1]);
    }
    return res_data_arr;
}

function drawChart(lang,knife_number,teeth_number) {
    var pred_label,real_label,run_text,chart_title,tool_wear_text;
    if(lang === "zh"){
        pred_label = "预测值";
        real_label = "真实值";
        run_text = "行程";
        chart_title = "第.# "+knife_number+"把刀的第"+teeth_number+"刀刃的磨损量";
        tool_wear_text = "磨损量";
    }
    else {
        pred_label = "predicted";
        real_label = "real";
        run_text = "Run";
        chart_title = "Tool wear of No.# "+knife_number+"'s "+teeth_number+" teeth";
        tool_wear_text = "Tool wear";
    }
    var x_data_arr = [];
    for(let i=0;i<315;i++){
        x_data_arr.push(i+1);
    }

    var pred_data = get_data_array(raw_data["predicted"],knife_number,teeth_number);
    var real_data = get_data_array(raw_data["real"],knife_number,teeth_number);
    console.log(real_data);
    console.log(pred_data);
    var option={
        title:{
            text:chart_title,
            align:"center"
        },
        xAxis: {
            type: 'category',
            name: run_text,
            data: x_data_arr
        },
        yAxis: {
            type: 'value',
            name: tool_wear_text
        },
        legend:{
            data:[pred_label,real_label],
            right:"1rem"
        },
        series: [{
            data: pred_data,
            type: 'line',
            name: pred_label,
            smooth: true,
            itemStyle:{
                normal:{
                    lineStyle:{
                        color:'#e74c3c',
                    }
                }
            }

        },{
            data: real_data,
            type: 'line',
            name: real_label,
            smooth: true,
            itemStyle:{
                normal:{
                    lineStyle:{
                        color:'#2980b9',
                    }
                }
            }
        },]

    }

    resChart.setOption(option);
}

function getRandomIntInclusive(min, max) {
    min = Math.ceil(min);
    max = Math.floor(max);
    return Math.floor(Math.random() * (max - min + 1)) + min; //The maximum is inclusive and the minimum is inclusive
}

